import * as React from 'react';
import "../css/home.css";
import NavBar from '../dynamic/NavBar';
import { useSpring, animated } from '@react-spring/web';


function Home(){
return(
    <div id='homeContainer'>
        <NavBar/>
        <div id='contentContainer'>
           <div id="skyContainer">
            <Parallax pages = {1} style = {{top: '0',left:'0'}}>

            </Parallax>
           </div>
        </div>

    
    </div>
);
}

export default Home;
